script: |
  super -f text -I q9325.spq | sort > q9325.out

inputs:
  - name: q9325.spq
    data: |
      SELECT col1 + col1 FROM tab1 (FORMAT parquet) WHERE - col2 + + col0 * + col0 * - col1 NOT IN ( - col1 + + col0 / + col2 );
  - name: tab1

outputs:
  - name: q9325.out
    data: |
      20
      26
      52
